    res = []
    left = 1
    i = 0
    color = 0
    for h in range(height):
        tot = 0
        tmp = []
        if color == 1:
            tmp.append(0)
        while tot < width and i < len(compressed):
            if left:
                if left <= width:
                    tmp.append(left)
                    tot = left
                    left = 0
                    color = 1 - color
                else:
                    tmp.append(width)
                    tot = width
                    left -= width
            else:
                val = compressed[i]
                i += 1
                if tot + val <= width:
                    tmp.append(val)
                    tot += val
                    color = 1 - color
                else:
                    tmp.append(width - tot)
                    left = tot + val - width
                    tot = width
        if len(tmp) % 2:
            tmp.append(left if h == height - 1 else 0)
        res.append(tmp)
    return res

